import React from "react";
import style from './Pagination.module.css';

const Pagination = (props) => {

    return (
        <div class='pagination'>
            <button class="floating-button">back</button>
            <button class="floating-button">1</button>
            <button class="floating-button">2</button>
            <button class="floating-button">3</button>
            <button class="floating-button">4</button>
            <button class="floating-button">5</button>
            <button class="floating-button">forward</button>
        </div>
    )
}

export default Pagination;
